USE [master]
GO

/*******************************************************************************
   Drop database if it exists
********************************************************************************/
IF EXISTS (SELECT name FROM master.dbo.sysdatabases WHERE name = N'PE_DBI202_Fa2024')
BEGIN
	ALTER DATABASE PE_DBI202_Fa2024 SET OFFLINE WITH ROLLBACK IMMEDIATE;
	ALTER DATABASE PE_DBI202_Fa2024 SET ONLINE;
	DROP DATABASE PE_DBI202_Fa2024;
END

GO

CREATE DATABASE PE_DBI202_Fa2024
GO

USE PE_DBI202_Fa2024
GO

/*******************************************************************************
	Drop tables if exists
*******************************************************************************/
DECLARE @sql nvarchar(MAX) 
SET @sql = N'' 

SELECT @sql = @sql + N'ALTER TABLE ' + QUOTENAME(KCU1.TABLE_SCHEMA) 
    + N'.' + QUOTENAME(KCU1.TABLE_NAME) 
    + N' DROP CONSTRAINT ' -- + QUOTENAME(rc.CONSTRAINT_SCHEMA)  + N'.'  -- not in MS-SQL
    + QUOTENAME(rc.CONSTRAINT_NAME) + N'; ' + CHAR(13) + CHAR(10) 
FROM INFORMATION_SCHEMA.REFERENTIAL_CONSTRAINTS AS RC 

INNER JOIN INFORMATION_SCHEMA.KEY_COLUMN_USAGE AS KCU1 
    ON KCU1.CONSTRAINT_CATALOG = RC.CONSTRAINT_CATALOG  
    AND KCU1.CONSTRAINT_SCHEMA = RC.CONSTRAINT_SCHEMA 
    AND KCU1.CONSTRAINT_NAME = RC.CONSTRAINT_NAME 

EXECUTE(@sql) 

GO
DECLARE @sql2 NVARCHAR(max)=''

SELECT @sql2 += ' Drop table ' + QUOTENAME(TABLE_SCHEMA) + '.'+ QUOTENAME(TABLE_NAME) + '; '
FROM   INFORMATION_SCHEMA.TABLES
WHERE  TABLE_TYPE = 'BASE TABLE'

Exec Sp_executesql @sql2 
GO 

---------------------------- Create table ----------------------------------
CREATE TABLE Departments (
    DepartmentID INT PRIMARY KEY,
    Name NVARCHAR(100) NOT NULL unique,
    Location NVARCHAR(100),
    PhoneNumber NVARCHAR(15)
);

CREATE TABLE Patients (
    PatientID INT PRIMARY KEY,
    FirstName NVARCHAR(50) NOT NULL,
    LastName NVARCHAR(50) NOT NULL,
    DateOfBirth DATE NOT NULL,
    PhoneNumber NVARCHAR(15),
    Email NVARCHAR(100),
    Address NVARCHAR(255)
);

CREATE TABLE Doctors (
    DoctorID INT PRIMARY KEY,
    FirstName NVARCHAR(50) NOT NULL,
    LastName NVARCHAR(50) NOT NULL,
    PhoneNumber NVARCHAR(15),
    Email NVARCHAR(100),
	DepartmentID INT not null REFERENCES Departments(DepartmentID)
);

CREATE TABLE Appointments (
    AppointmentID INT PRIMARY KEY,
    PatientID INT REFERENCES Patients(PatientID),
    DoctorID INT REFERENCES Doctors(DoctorID),
    AppointmentDate DATETIME NOT NULL,
    Reason NVARCHAR(255),
    Status NVARCHAR(20) CHECK (Status IN ('Scheduled', 'Completed', 'Cancelled'))
);

CREATE TABLE Tests (
    TestID INT PRIMARY KEY,
    Name NVARCHAR(100) NOT NULL unique,
    Description NVARCHAR(255),
    Cost DECIMAL(10, 2) 
);

CREATE TABLE AppointmentTests (
    AppointmentTestID INT PRIMARY KEY,
    AppointmentID INT REFERENCES Appointments(AppointmentID),
    TestID INT REFERENCES Tests(TestID),
    Status NVARCHAR(20) CHECK (Status IN ('Pending', 'Completed', 'Cancelled')),
	Result nvarchar(255)
);

CREATE TABLE MedicalRecords (
    RecordID INT PRIMARY KEY,
    AppointmentID INT REFERENCES Appointments(AppointmentID),
    Diagnosis NVARCHAR(255),
    Treatment NVARCHAR(255),
    Notes NVARCHAR(MAX),
    RecordDate DATETIME
);

